// SPDX-License-Identifier: Unlicensed
pragma solidity >=0.5.0;
pragma experimental ABIEncoderV2;

import '../interfaces/IERC20.sol';
import "../open/utils/Initializable.sol";
import "../open/token/ERC721/IERC721.sol";
import "../open/token/ERC721/utils/ERC721Holder.sol";
import "../open/token/ERC1155/IERC1155.sol";
import "../open/token/ERC1155/utils/ERC1155Holder.sol";
import "../open/utils/Ownable.sol";
import "../nftLib/FishNftFactory.sol";


contract Ncomp is ERC721Holder,ERC1155Holder,Initializable,Ownable{

    IERC1155 public needNToken;

    IERC1155 public compNToken;

    Nft1155Factory public needNftFactory;

    Nft1155Factory public compNftFactory;

    uint internal compNftLevel;

    struct BoxResult{
        address nft;    
        uint level;
    }

    mapping( bytes32 => BoxResult) public boxResults;

    uint internal product = 24;
    uint internal sum = 10;

    constructor() public {}


    function initialize(
        address _needNToken,
        address _compNToken,
        address _needNftFactory,
        address _compNftFactory,
        address _ownerAddress
    ) public initializer {
        needNToken = IERC1155(_needNToken);
        compNToken = IERC1155(_compNToken);
        needNftFactory = Nft1155Factory(_needNftFactory);
        compNftFactory = Nft1155Factory(_compNftFactory);
        product = 24;
        sum = 10;
        compNftLevel = 5;
        _owner = _ownerAddress;
    }

    function comp(uint[] calldata ids,bytes32 flag)external {

        uint len = ids.length;

        require(len == 4,"nft lock");

        uint _product = 1;
        uint _sum = 0;
        uint[] memory amounts = new uint[](4);
        for( uint i = 0; i < len; i++ ){
            _product *= ids[i];
            _sum += ids[i];
            amounts[i] = 1;
        }

        require( _product == product && _sum == sum,"not allow" );

        //前期先放合约，后期燃烧掉
        needNToken.safeBatchTransferFrom(msg.sender, address(0x1), ids, amounts, "");


        compNftFactory.mint(msg.sender, compNftLevel, 1);

        boxResults[flag] = BoxResult(
            address(compNToken),
            compNftLevel
        );
    }
}
